import React from 'react'
import Recipe from './Recipe'
import '../css'
function RecipeList({ recipes }) {
    return (
        <>
        <div>
            {recipes.map(recipe => {
                return <Recipe key={recipe.id} {...recipe} />
            })}
        </div>
       <button>Add Recipe</button>
       </>
    )
}

export default RecipeList
